import React, { useState, useEffect } from 'react';
import { useTrans } from '../../../context/TransactionContext';

const baseBanks = {
  Food: 0, Shelter: 0, Gas: 0, Bike: 0,
  Stationary: 0, Smoke: 0, Shopping: 0,
  Washing: 0, Wine: 0, Medicine: 0,
  Jio: 0, Misc: 0
};

const monthsMap = {
  '01': 'Jan', '02': 'Feb', '03': 'Mar', '04': 'Apr',
  '05': 'May', '06': 'Jun', '07': 'Jul', '08': 'Aug',
  '09': 'Sep', '10': 'Oct', '11': 'Nov', '12': 'Dec'
};

function getFreshYearMap() {
  const monthObj = {};
  for (let i = 1; i <= 12; i++) {
    const num = i.toString().padStart(2, '0');
    const name = new Date(2000, i - 1).toLocaleString('en-US', { month: 'short' });
    monthObj[num] = [name, { ...baseBanks }];
  }
  return monthObj;
}

function Showexpense({ data }) {
  const [view, setView] = useState('');
  const [selector, setSelector] = useState([]);
  const [giveView, setGiveView] = useState({});
  const { trans } = useTrans();
  const [ duration, setDuration] = useState('monthly')




const dataProcessing = () => {
  const yearMap = {};

  data.forEach(entry => {
    const year = entry.date.slice(0, 4);
    const month = entry.date.slice(5, 7);
    const bank = entry.category;
    const amount = Number(entry.amount || 0);
   
    if (!yearMap[year]) {
      yearMap[year] = getFreshYearMap();
    }

    if (yearMap[year][month] && yearMap[year][month][1][bank] !== undefined) {
      yearMap[year][month][1][bank] += amount;
    }
  });

  const result = Object.entries(yearMap).sort((a, b) => b[0] - a[0]);
  setSelector(result);  // ✅ only this, let useEffect below handle view/giveView
};


  useEffect(() => {
    if (data && data.length > 0) {
      dataProcessing();
    }
  }, [data, trans]);

  useEffect(() => {
    const match = selector.find(([key]) => key === view);
    if (match) {
      setGiveView(match[1]);
    }
  }, [selector, view]);

  return (
    <>
      <h4>Expense Insight Summary</h4>
      <select value={view} onChange={(e) => setView(e.target.value)}>
        {
          selector.map(([key], idx) => (
            <option key={idx} value={key}>{key}</option>
          ))
        }
      </select>

      <pre>{JSON.stringify(giveView, null, 2)}</pre>
      <table>
        <thead>
          <tr>
            <th>
              <select value={duration} onChange={(e)=>setDuration(e.target.value)}>
                <option value='monthly'>Monthly</option>
                <option value='quarterly'>Quarterly</option>
                <option value='yearly'>Yearly</option>
              </select>
            </th>
            {
              Object.keys(baseBanks).map((val, ind)=>(
                <th colSpan="2" key={ind}>{val}</th>
              ))
            }
            <th>Total</th>
          </tr>
          <tr>
            <td></td>
             {
              Object.keys(baseBanks).map((val, ind)=>(
                <>
                <td key={ind}>Amt Spent</td>
                <td key={ind}>% Spent</td>
                </>
              ))
            }
            <td></td>
          </tr>
        </thead>
        <tbody>
          {
            Object.va
          }
        </tbody>
      </table>
    </>
  );
}

export default Showexpense;
